contour_vals = caxis_flux(1):0.2:caxis_flux(2);

load(in_file);

    glc_ext  = mpars.glc_ext;
    gamma_values = mpars.gamma_values
    glycogen = mpars.glycogen
    t_span   = mpars.t_span;
    
    % indeces of boundaries
    tmp = find(glc_ext>=glc_min); glc_min_ind = tmp(1);
    tmp = find(glc_ext<=glc_max); glc_max_ind = tmp(end);
    tmp = find(gamma_values>=gamma_min); gamma_min_ind = tmp(1);
    tmp = find(gamma_values<=gamma_max); gamma_max_ind = tmp(end);
    tmp = find(t_span>=t_eval); t_eval_ind = tmp(1);
