    x = glc_ext(glc_min_ind:glc_max_ind);
    y = gamma_values(gamma_min_ind:gamma_max_ind);

% Calculate the normal gamma_f(glc) curve for plotting on the surface
y_2 = gamma_f(  hormone_abs(x, 'insulin', 'normal'), ... 
                hormone_abs(x, 'glucagon', 'normal'), ...
                hormone_abs(x, 'epinephrine', 'normal'));
y_3 = gamma_f(  hormone_abs(x, 'insulin', 'T2DM'), ... 
                hormone_abs(x, 'glucagon', 'T2DM'), ...
                hormone_abs(x, 'epinephrine', 'T2DM'));
y_4 = gamma_f(  hormone_abs(x, 'insulin', 'extreme_T2DM'), ... 
                hormone_abs(x, 'glucagon', 'extreme_T2DM'), ...
                hormone_abs(x, 'epinephrine', 'extreme_T2DM'));
